import Hero from "./Hero Section";
import ProductSkeleton from "./Product Grid";
import Footer from "./Footer";

function Home() {
  return (
    <>
      <Navbar />
      <Hero />

      <section className="products">
        {[...Array(8)].map((_, i) => (
          <ProductSkeleton key={i} />
        ))}
      </section>

      <Footer />
    </>
  );
}

export default Home;
